And it‚Äôs a phenomenal question, so I‚Äôm gonna talk about it.

To be short, and blunt, and factual...if you‚Äôre not losing weight, you‚Äôre not in a calorie deficit.

Now I KNOW, it might look like you are on paper, but you simply are not.

And there‚Äôs a plethora of factors that could be responsible for this.

It could be that you overestimated how many calories you need to be eating to lose weight.

It could be that you under estimate how many calories are in the food/drinks you ingest day to day.

It could be that your metabolic rate has slowed to match the energy balance you‚Äôre currently living in.

It could be MANY things.

But the fact is, if you‚Äôre eating 1500 cals and you‚Äôre not losing weight, you‚Äôre not in a deficit.

If you‚Äôre eating 1200 cals and you‚Äôre not losing weight, you‚Äôre not in a deficit.

That‚Äôs not my opinion, it‚Äôs a universal truth.

So what do we do? What do you do if you feel like you‚Äôre eating for a rabbit but you‚Äôre STILL not in a deficit?

Well, I cant generalize ALL situations, but usually I would...increase calories.

You know, like I‚Äôve done with almost every transformation on my page.

I would increase calories(energy) so you could burn more calories(energy).

So you‚Äôd have more energy to lift more volume in the gym, go for a longer walk with your dog, and dance around the house in your underwear.

See...nobody ever said you need to take away calories to lose weight.

They said you need to be in a calorie deficit.

And sometimes that does mean reducing calorie intake. Sometimes is means increasing activity. And sometimes it means increasing calorie intake so we have the energy to increase activity(and create the, ever so elusive, deficit we‚Äôre searching for).

Makes sense, right?

There‚Äôs multiple paths to creating a calorie deficit, and you‚Äôre just not using the one that‚Äôs optimal for you and your body, right now.

You‚Äôre not broken. Not at all.

You just need to take the next exit and try a different path.
